#include <iostream>
int main(int argc, char** argv) {
std::cout << "Hello, World!" << std::endl;
return 0;
}
Теперь можно определить, что пространство имен - это именнованная область видимости, где можно определить набор классов, функций, переменных, обратиться к которым можно посредством указания имени соответствующего неймспейса с использованием оператора разрешения области видимости '::'.
Внутри неймспейса допустимо использовать такие же имена для функций, классов и переменных, как в других пространствах имен, и даже как в глобальной области видимости.
Таким образом, в рамках одной и той же программы, могут существовать, например, две одинаковых переменных с одним и тем же названием, но находящихся в разных неймспейсах.
Можно также создавать вложенные неймспейсы. Получать доступ к каждому такому неймспейсу можно через последовательное использование оператора разрешения области видимости.
Ex. std::chrono::day <- обращение к классу day в неймспейсе chrono в неймспейсе std
